  { id: '0', name: 'West-Vlaanderen' },
  { id: '1', name: 'Oost-Vlaanderen' },
  { id: '2', name: 'Luik' },
  { id: '0', name: 'Antwerpen' },
  { id: '1', name: 'Limburg' },
  { id: '2', name: 'Luik' }
]

const usersSlice = createSlice({
  name: 'users',
  initialState,
  reducers: {
      
